import React from "react";

export const Pagination = ({ page, setpage, len }) => {
  const arr = [...Array(3)];
  console.log(arr);
  return (
    <div>
      {page}
      <button
        onClick={() => {
          if (page > 1) setpage((prev) => prev - 1);
        }}
      >
        PREV
      </button>

      <span>
        {[...Array(3)].map((_, i) => {
          return <button onClick={setpage(i + 1)}>{i + 4}</button>;
        })}
      </span>
      <button
        onClick={() => {
          if (page < len) setpage((prev) => prev + 1);
        }}
      >
        PREV
      </button>
    </div>
  );
};
